    <div>
      <br />
      <br />
      <br />
      <br />
      <p> results for: {router.query.key}</p>
      <div>
        {result.map((item, index) => {
            return (
              <PastCard
                key={item.id}
                title={item.name}
                detail={item.details}
                image={item.links.patch.small}
                number={item.flight_number}
                date={item.date_local}
                succes={item.succes ? "succes" : "fail"}
              />
            );

        })}
        { }
      </div>
    </div>
  );
};

export default Result;
